import React from 'react'
import { makeStyles,withStyles } from "@material-ui/core";

const useStyles = makeStyles({
    appmain:{
        display: 'flex',
        flexDirection: 'column',
        position: 'absolute',
        top : '75px',
        left : '235px',
        width : '100%',
        height : '100%',
        backgroundColor : '#fff'

    }
})



function Date() {
    return (
        <div style={{position:'static', marginLeft:'1000px', backgroundColor:'black', width:'100px'}}>
            LOLO
        </div>
    )
}


export default function AppMain() {
    const classes = useStyles()
    return (
        <div className={classes.appmain}>
            <span>Hello</span><span>Shivam</span>
            <span style={{paddingLeft:'25px', paddingTop:'20px', width:'200px'}}>LOL</span><span>lol</span><Date />
            <font style={{paddingLeft:'25px', paddingTop:'20px', width:'200px'}}>Patient Information</font>
            
            <font style={{paddingRight:'0px'}}>LOL</font>
        </div>
    )
}
